\"hover\":null},\"evals\":[],\"jsHooks\":{\"render\":[{\"code\":\"function(el,x){\\n                        console.log(123);\\n                        if(!iii){\\n                          window.location.reload();\\n                          iii = False;\\n\\n                        }\\n  }\",\"data\":null}]}}</script>\n","\t</body>\n","</html>\n"],"text/plain":["HTML widgets cannot be represented in plain text (need html)"]},"metadata":{"text/html":{"isolated":true}},"output_type":"display_data"}],"source":["text <- readLines(\"../input/gdprfines/gdprarticles.txt\")\n","TextDoc <- Corpus(VectorSource(text))\n","\n","# Cleaning up Text Data\n","toSpace <- content_transformer(function (x , pattern ) gsub(pattern, \" \", x))\n","TextDoc <- tm_map(TextDoc, toSpace, \"/\")\n","TextDoc <- tm_map(TextDoc, toSpace, \"@\")\n","TextDoc <- tm_map(TextDoc, toSpace, \"\\\\|\")\n","\n","TextDoc <- tm_map(TextDoc, content_transformer(tolower))\n","TextDoc <- tm_map(TextDoc, removeWords, stopwords(\"english\"))\n","\n","TextDoc <- tm_map(TextDoc, removeWords, c(\"s\", \"art\", \"gdpr\")) \n","\n","TextDoc <- tm_map(TextDoc, removePunctuation)\n","\n","TextDoc <- tm_map(TextDoc, stripWhitespace)\n","\n","TextDoc <- tm_map(TextDoc, stemDocument)\n","\n","# Building the term document matrix\n","TextDoc_dtm <- TermDocumentMatrix(TextDoc)\n","dtm_m <- as.matrix(TextDoc_dtm)\n","\n","dtm_v <- sort(rowSums(dtm_m),decreasing=TRUE)\n","dtm_d <- data.frame(word = names(dtm_v),freq=dtm_v)\n","\n","wordcloud2(data=dtm_d, size=0.7, color='random-dark')"]},{"cell_type":"markdown","id":"90bbea2a","metadata":{"papermill":{"duration":0.00716,"end_time":"2023-08-06T20:37:06.239788","exception":false,"start_time":"2023-08-06T20:37:06.232628","status":"completed"},"tags":[]},"source":["**Evaluation Word Cloud**\n","\n","**Article 5** is the most commonly violated GDPR article, with 37% of all fines being issued for violations of this article. This article requires that personal data be processed fairly and lawfully, and that it be collected for specific, explicit, and legitimate purposes.\n","\n","**Article 6** is the second most commonly violated GDPR article, with 25% of all fines being issued for violations of this article. This article sets out the lawful bases for processing personal data, such as consent, contract, and legal obligation.\n","\n","**Article 32** is the third most commonly violated GDPR article, with 15% of all fines being issued for violations of this article. This article requires that personal data be processed securely, and that appropriate technical and organizational measures be taken to protect personal data from unauthorized access, use, disclosure, alteration, or destruction.\n","\n","**Articles 7, 13, and 14** are all related to the right of access, which gives individuals the right to access their personal data and to receive information about how their data is being processed. These articles are collectively responsible for 10% of all fines.\n","\n","**Articles 25 and 35** are both related to data protection by design and default, which requires that data protection be considered at the outset of any processing activity. These articles are collectively responsible for 5% of all fines."]},{"cell_type":"code","execution_count":3,"id":"50cc1586","metadata":{"execution":{"iopub.execute_input":"2023-08-06T20:37:06.258521Z","iopub.status.busy":"2023-08-06T20:37:06.256846Z","iopub.status.idle":"2023-08-06T20:37:06.808109Z","shell.execute_reply":"2023-08-06T20:37:06.806193Z"},"papermill":{"duration":0.564083,"end_time":"2023-08-06T20:37:06.811162","exception":false,"start_time":"2023-08-06T20:37:06.247079","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message in tm_map.SimpleCorpus(TextDoc, toSpace, \"/\"):\n","“transformation drops documents”\n","Warning message in tm_map.SimpleCorpus(TextDoc, toSpace, \"@\"):\n","“transformation drops documents”\n","Warning message in tm_map.Simp