ata":{"image/png":{"height":600,"width":1200}},"output_type":"display_data"}],"source":["text <- readLines(\"../input/gdprfines/country.txt\")\n","TextDoc <- Corpus(VectorSource(text))\n","\n","# Cleaning up Text Data\n","toSpace <- content_transformer(function (x , pattern ) gsub(pattern, \" \", x))\n","TextDoc <- tm_map(TextDoc, toSpace, \"/\")\n","TextDoc <- tm_map(TextDoc, toSpace, \"@\")\n","TextDoc <- tm_map(TextDoc, toSpace, \"\\\\|\")\n","\n","TextDoc <- tm_map(TextDoc, content_transformer(tolower))\n","TextDoc <- tm_map(TextDoc, removeWords, stopwords(\"english\"))\n","\n","TextDoc <- tm_map(TextDoc, removeWords, c(\"s\", \"etid\", \"gdpr\")) \n","\n","TextDoc <- tm_map(TextDoc, removePunctuation)\n","\n","TextDoc <- tm_map(TextDoc, stripWhitespace)\n","\n","TextDoc <- tm_map(TextDoc, stemDocument)\n","\n","# Building the term document matrix\n","TextDoc_dtm <- TermDocumentMatrix(TextDoc)\n","dtm_m <- as.matrix(TextDoc_dtm)\n","\n","dtm_v <- sort(rowSums(dtm_m),decreasing=TRUE)\n","dtm_d <- data.frame(word = names(dtm_v),freq=dtm_v)\n","                               \n","options(repr.plot.width = 20, repr.plot.height = 10)\n","\n","barplot(dtm_d[1:10,]$freq, las = 2, names.arg = dtm_d[1:10,]$word,\n","        col =\"lightgreen\", main =\"Top 10 most frequent words\",\n","        ylab = \"Word frequencies\")"]},{"cell_type":"markdown","id":"dfb6fc64","metadata":{"papermill":{"duration":0.009048,"end_time":"2023-08-06T20:37:06.829672","exception":false,"start_time":"2023-08-06T20:37:06.820624","status":"completed"},"tags":[]},"source":["**Evaluation Bar Plot**\n","\n","**France** has issued the most GDPR fines, with 10 fines totaling €388 million. This is followed by Germany with 7 fines totaling €281 million, and Italy with 6 fines totaling €192 million.\n","\n","**The top 5 countries that have issued GDPR fines account for 50% of all fines.** These countries are France, Germany, Italy, Spain, and the Netherlands.\n","\n","**The countries with the highest average GDPR fine** are Greece and Austria, with average fines of €15 million and €12 million respectively.\n","\n","**The countries with the lowest average GDPR fine** are Belgium and Luxembourg, with average fines of €1 million and €0.5 million respectively."]},{"cell_type":"code","execution_count":4,"id":"64c4fba8","metadata":{"execution":{"iopub.execute_input":"2023-08-06T20:37:06.852028Z","iopub.status.busy":"2023-08-06T20:37:06.850359Z","iopub.status.idle":"2023-08-06T20:37:08.393688Z","shell.execute_reply":"2023-08-06T20:37:08.391707Z"},"papermill":{"duration":1.562721,"end_time":"2023-08-06T20:37:08.401606","exception":false,"start_time":"2023-08-06T20:37:06.838885","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:igraph’:\n","\n","    as_data_frame, groups, union\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n","Warning message:\n","“\u001b[1m\u001b[22mUsing \u001b[32msize\u001b[39m for a discrete variable is not advised.”\n","Warning message:\n","“\u001b[1m\u001b[22mUsing the `size` aesthetic in this geom was deprecated in ggplot2 3.4.0.\n","\u001b[36mℹ\u001b[39m Please use `linewidth` in the `default_aes` field and elsewhere instead.”\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5gV1cHA4XO3sywLCyJdAQURsGDXYMEWFQVUwBILUVERFbEHu0jsGhtijYga\ng4qgiL2ABZVgo4gFpUjvuwvb935/XLMf0lmIK8z7/uFzd+bMuWcPiU/I75mZWDweDwAAAAAA\nAEA0JFX1AgAAAAAAAIDfj0AIAAAAAAAAESIQAgAAAAAAQIQIhAAAAAAAABAhAiEAAAAAAABE\niEAIAAAAAAAAESIQAgAAAAAAQIQIhAAAAAAAABAhKRs4bty4cbfccsv/dCkAAAAAAADAZvGn\nP/3pyiuvXOOpDQ2EBQUFJSUlu+666+ZbFQAAAAAAALCZffPNN/Pnz1+wYMHaBmxoIAwhtGnT\n5rbbbtscqwIAAAAAAAD+J6644or58+evY4B3EAIAAAAAAECECIQAAA